import React from 'react';
import './App.css';

import ReactPlayer from 'react-player'



function App() {

  return (
    <div className="App">

        <div className="player-wrapper">
          <ReactPlayer
            className="react-player"
            url={'https://vimeo.com/575873877'}
            autoPlay={true}
            width={'100%'}
            height={'100%'}
          />
         </div>
    </div>
  );
}

export default App;
